import { Grid, Typography } from "@mui/material";
import React from "react";
import CustomLeftBox from "../../components/CustomLeftBox";
import IntroduceText from "../../components/IntroduceText";
import Page from "../../components/Page";

function Guide() {
  return (
    <Page title="BANTO PARTNERS">
      <Grid
        container
        spacing={2}
        justifyContent="center"
        alignItems="center"
        mt={3}
      >
        <Grid item xs={12} lg={12}>
          <IntroduceText firstLine="파트너스" secondLine="서비스 소개" />
        </Grid>
        <Grid item xs={12} lg={12}>
          <CustomLeftBox sx={{ backgroundColor: "#FAFAFA", padding: "10px" }}>
            <Typography fontSize={30}>세일즈 가이드 라인 참고하세요</Typography>
          </CustomLeftBox>
        </Grid>
        <Grid item xs={12} lg={12}></Grid>
        <Grid item xs={12} lg={12}></Grid>
        <Grid item xs={12} lg={12}></Grid>
        <Grid item xs={12} lg={12}></Grid>
        <Grid item xs={12} lg={12}></Grid>
        <Grid item xs={12} lg={12}></Grid>
      </Grid>
    </Page>
  );
}

export default Guide;
